    function removeRepeatedWord(texto) {
        // Divide o texto em palavras individuais
        const palavras = texto.split(/\s+/);
        
        // Cria um conjunto para armazenar as palavras únicas
        const palavrasUnicas = new Set();
        
        // Filtra as palavras repetidas e adiciona as únicas ao conjunto
        const palavrasFiltradas = palavras.filter(palavra => {
            if (palavrasUnicas.has(palavra)) {
                return false; // Palavra repetida, não incluir
            } else {
                palavrasUnicas.add(palavra);
                return true; // Palavra única, incluir
            }
        });
        
        // Reconstroi o texto com as palavras únicas
        const novoTexto = palavrasFiltradas.join(' ');
        
        return novoTexto;
    }
    function checkIncludedWord(word, check){ //verifica se a palavra esta inclusa
        if (word.toUpperCase().includes(check.toUpperCase())) {
            return true
        }else{
            return false
        }
    }
